import React from 'react';
import './home.css';

const Home = () => {
    return (
        <div className="home-container">
            <header className="home-header">
                <h1>Welcome to Our Salon</h1>
                <p>Your beauty is our duty</p>
            </header>
            <section className="services">
                <h2>Our Services</h2>
                <ul>
                    <li>Haircut</li>
                    <li>Hair Coloring</li>
                    <li>Manicure</li>
                    <li>Pedicure</li>
                    <li>Facial</li>
                </ul>
            </section>
            <section className="about-us">
                <h2>About Us</h2>
                <p>We are a full-service salon dedicated to making you look and feel your best. Our experienced staff is here to provide you with top-notch services in a relaxing and welcoming environment.</p>
            </section>
            <footer className="home-footer">
                <p>Contact us at (123) 456-7890 or visit us at 123 Beauty St, Salon City</p>
            </footer>
        </div>
    );
};

export default Home;
